	$(window).scroll(function() {
		var windowsHeight = $(document).height() - $(window).height();
		var currentScroll = $(document).scrollTop();

		//if I scroll more than 80%
		if( ((currentScroll *100) / windowsHeight) > 60){
			$(".byebyee-l-page__up").addClass("open");
		} else{
			$(".byebyee-l-page__up").removeClass("open");
		}
	});

	$(".byebyee-l-page__up").click(function() {
		$("html, body").animate({ scrollTop: 0 }, 900, 'swing');
		return false;
	});

	
